(function() {
    'use strict';

    angular
        .module('app')
        .factory('listService', listService);


    listService.$inject = ['$http'];


    function listService($http){

        var url = 'http:localhost/8080/pokemons';


        var PokemonList = $resource(server+'/establishments/:id', {id:'@id'},{
                getPokemons:{
                    method: 'POST',
                    url: url,
                }
            }
        );
        var service = {
            getList: getList
        };

        return service;


        function getList(){
            return PokemonList.getPokemons().$promise
                .then(getListSuccess)
                .catch(getLisFailed);

            function getListSuccess(data){
                console.log(data);
                return data.data.data;
            }

            function getLisFailed(){
                return false;
            }
        }
    }

})();
